define({"topics" : [{"title":"Creating unregistered TA bugs","shortdesc":"\n                     <p class=\"shortdesc\">An unregistered TestArchitect bug (TA bug) is one that is created in <span class=\"ph\">TestArchitect</span> but it is not associated with a JIRA             bug.\n                     </p>\n                  ","id":"task_o5m_v4x_1m","href":"TA_Help\/Topics\/JIRA_creating_unregistered_bugs.html","menu": {"hasChildren":false,},"tocID":"task_o5m_v4x_1m-d46e21016","topics":[]},{"title":"Working with known bugs","shortdesc":"\n                     <p class=\"shortdesc\"><dfn class=\"term\">Known bugs</dfn> indicate where fails in a test have     been recognized so that those fails are ignored in subsequent automation run results.\n                        The       <dfn class=\"term\">Ignore known bug</dfn> feature helps you obtain test results from test runs that are     not cluttered up with fails from known bugs, thus rendering\n                        the results easier to     analyze.\n                     </p>\n                  ","id":"concept_working_known_bugs","href":"TA_Help\/Topics\/Bugs_working_known_bug.html","menu": {"hasChildren":false,},"tocID":"concept_working_known_bugs-d46e21030","next":"concept_working_known_bugs-d46e21030",},{"title":"Viewing TA bugs","shortdesc":"\n                     <p class=\"shortdesc\">How to access existing TA bugs.</p>\n                  ","id":"task_nq1_1m2_bm","href":"TA_Help\/Topics\/Bug_opening.html","menu": {"hasChildren":false,},"tocID":"task_nq1_1m2_bm-d46e21092","topics":[]},{"title":"Deleting TA bugs","shortdesc":"\n                     <p class=\"shortdesc\">TA bugs can be removed from the system once they have been addressed.</p>\n                  ","id":"task_tr4_xm2_bm","href":"TA_Help\/Topics\/Bugs_deleting.html","menu": {"hasChildren":false,},"tocID":"task_tr4_xm2_bm-d46e21103","topics":[]}]});